INSERT INTO `hhs_article` VALUES ('48', '23', '如何兑换商品', '<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<span><span><span style=\"font-size:24px;\">1.</span><span style=\"font-size:24px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:宋体;font-size:24px;\">在用户中心点击“积分商城”进入积分兑换页面</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span><img src=\"data:image/png;base64,\" alt=\"\" /></span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<span><span><span style=\"font-size:24px;\">2.</span><span style=\"font-size:24px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:宋体;font-size:24px;\">积分兑换页面展示出可供兑换的商品以及需要的积分数值</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span><img src=\"/images/upload/image/20160630/20160630105629_17841.png\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<span><span><span style=\"font-size:24px;\">3.</span><span style=\"font-size:24px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:宋体;font-size:24px;\">选中兑换商品进入商品详情页面兑换商品</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span><img src=\"/images/upload/image/20160630/20160630105644_23619.png\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span style=\"font-size:24px;\">&nbsp;</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<span><span><span style=\"font-size:24px;\">4.</span><span style=\"font-size:24px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:24px;\"><span style=\"font-size:24px;\">&nbsp;</span></span><span style=\"font-family:宋体;font-size:24px;\">进入兑换流程页面提交数据</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span><img src=\"/images/upload/image/20160630/20160630105702_25968.png\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<span><span><span style=\"font-size:24px;\">5.</span><span style=\"font-size:24px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:宋体;font-size:24px;\">数据提交后可查阅支付的订单信息</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span><img src=\"/images/upload/image/20160630/20160630105717_96292.png\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<span><span><span style=\"font-size:24px;\">6.</span><span style=\"font-size:24px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:宋体;font-size:24px;\">微信推送消息给用户</span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span><img src=\"data:image/png;base64,\" alt=\"\" /></span> \r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<span style=\"font-size:24px;\">&nbsp;</span> \r\n</p>\r\n<br />', '', '', '', '1', '1', '1462576953', 'data/article/1462831263876445815.jpg', '2', '', '', null, null, null, '');
