INSERT INTO `hhs_article` VALUES ('52', '15', '123', '<p>\r\n	http://wfx.hostadmin.com.cn/index.php\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	谷丰关闭后规范化吗\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<ul>\r\n	<li>\r\n		<img src=\"/images/upload/image/20161028/20161028172551_99115.jpg\" alt=\"\" />\r\n	</li>\r\n	<li>\r\n		在分类页上方添加轮播广告\r\n	</li>\r\n	<li>\r\n		二、&nbsp;&nbsp; &nbsp;在拼团页上方添加轮播广告\r\n	</li>\r\n	<li>\r\n		三、&nbsp;&nbsp; &nbsp;“拼团”“分类”&nbsp; 可以改动名称\r\n	</li>\r\n	<li>\r\n		四、&nbsp;&nbsp; &nbsp; 地址页详细地址里面添加一句提示语，用户填写时消失。\r\n	</li>\r\n	<li>\r\n		五、&nbsp;&nbsp; &nbsp;在分类页和详情页显示商品库存，启用库存则显示，不启用则不显示。\r\n	</li>\r\n	<li>\r\n		六、&nbsp;&nbsp; &nbsp;将 市内快递 改名为 送货上门，包邮提醒相应改动。\r\n	</li>\r\n</ul>\r\n<p>\r\n	<img src=\"/images/upload/image/20161028/20161028172505_26934.jpg\" alt=\"\" title=\"\" height=\"800\" width=\"800\" align=\"left\" />\r\n</p>', '', '', '', '1', '1', '1467065445', 'data/article/1477614734789672888.jpg', '2', '', '', null, null, null, '');
